Our mom has been getting facials for a while (as she says…“to keep her skin healthy and glowing”). Since we are starting to get older now and have occasional breakouts here and there, we thought it would be fun to join her and try one for ourselves!!! What an amazing experience! Now we understand what our mon means when your skin actually glows ✨✨ If any of you guys live in Southern Cali come check out @nuagespa 💆🏻‍♀️ They offer monthly facials for tweens/teens to helps with acne prevention. They teach you the importance of taking care of your skin and can even set you up on a simple yet effective skin care regimen! This may have been our first facial… but it definitely won’t be our last! 😉
@deberodriguez.nuagespa 
